// UpdatedAtLTE applies the LTE predicate on the "updated_at" field.
func UpdatedAtLTE(v time.Time) predicate.PipelineRule {
	return predicate.PipelineRule(sql.FieldLTE(FieldUpdatedAt, v))
}

// HasConfig applies the HasEdge predicate on the "config" edge.
func HasConfig() predicate.PipelineRule {
	return predicate.PipelineRule(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ConfigTable, ConfigColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasConfigWith applies the HasEdge predicate on the "config" edge with a given conditions (other predicates).
func HasConfigWith(preds ...predicate.PipelineConfig) predicate.PipelineRule {
	return predicate.PipelineRule(func(s *sql.Selector) {
		step := newConfigStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.PipelineRule) predicate.PipelineRule {
	return predicate.PipelineRule(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.PipelineRule) predicate.PipelineRule {
	return predicate.PipelineRule(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.PipelineRule) predicate.PipelineRule {
	return predicate.PipelineRule(sql.NotPredicates(p))
}
